def run(value_list):
    """
    Calculates the 2019 average defined contribution schemes.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    scheme_data = [d for d in value_list if d['category'] == 'Defined contribution schemes']

    if not scheme_data:
        return (0.00, "")

    years = [d['number_value'] for d in scheme_data if d['header1'] == '2019 € million']

    if not years:
        return (0.00, "")

    average = sum(years) / len(years)

    return (round(average, 2), 'million')

def run(value_list):
    """
    Calculates the 2019 average free cash flow from the provided list.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the 2019 average free cash flow.
    """
    cash_flows_2019 = []
    for item in value_list:
        if item['header2'] == '2019':
            if item['category'] == 'Free cash flow':
                cash_flows_2019.append(item['number_value'])

    if not cash_flows_2019:
        return (0.00, "")

    average_cash_flow = sum(cash_flows_2019) / len(cash_flows_2019)
    return (round(average_cash_flow, 2), "million")

def run(value_list):
    """
    Calculates the average total current tax expense for 2017 and 2018.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average total current tax expense.
    """
    total_2017 = 0
    count_2017 = 0
    total_2018 = 0
    count_2018 = 0

    for item in value_list:
        if item['category'] == 'Total current tax expense' and item['header3'] == '2017':
            total_2017 += item['number_value']
            count_2017 += 1
        elif item['category'] == 'Total current tax expense' and item['header3'] == '2018':
            total_2018 += item['number_value']
            count_2018 += 1

    if count_2017 > 0 and count_2018 > 0:
        average = (total_2017 + total_2018) / (count_2017 + count_2018)
        return (round(average, 2), 'million')
    elif count_2017 > 0:
        return (round(total_2017 / count_2017, 2), 'million')
    elif count_2018 > 0:
        return (round(total_2018 / count_2018, 2), 'million')
    else:
        return (0.00, 'million')

