def run(value_list):
    """
    Calculates the average annual Total change in general and administrative expenses for fiscal year 2017 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    total_change = 0
    count = 0

    for item in value_list:
        if item['category'] == 'Total change in general and administrative expenses':
            if '2017 and 2018' in item['header1'] or '2018 and 2017' in item['header1']:
                total_change += item['number_value']
                count += 1

    if count > 0:
        average = total_change / count
        return (round(average, 2), 'thousand')
    else:
        return (0.00, '')

